content='MRSA sind Bakterien. Sie heißen Methicillin-resistenter Staphylococcus aureus. Diese Bakterien sind gegen starke Medikamente, die Antibiotika heißen, unempfindlich. Das bedeutet: Die Medikamente helfen nicht gegen diese Bakterien. MRSA können Wundinfektionen verursachen. Besonders gefährlich sind sie in Krankenhäusern. Dort sind oft sehr kranke Menschen. 

Es gibt Möglichkeiten, MRSA von der Haut und den Schleimhäuten zu entfernen. Das nennt man Sanierung von MRSA-Trägern. Das Robert Koch-Institut sagt, dass man es wenigstens versuchen sollte, MRSA zu sanieren. 

MRSA können auch von außen übertragen werden. Zum Beispiel durch die Hände von medizinischem Personal.' additional_kwargs={'refusal': None} response_metadata={'token_usage': {'completion_tokens': 153, 'prompt_tokens': 755, 'total_tokens': 908, 'completion_tokens_details': {'audio_tokens': 0, 'reasoning_tokens': 0, 'accepted_prediction_tokens': 0, 'rejected_prediction_tokens': 0}, 'prompt_tokens_details': {'audio_tokens': 0, 'cached_tokens': 0}}, 'model_name': 'gpt-4o-mini-2024-07-18', 'system_fingerprint': 'fp_0ba0d124f1', 'finish_reason': 'stop', 'logprobs': None} id='run-3c2a350c-a637-4793-8e27-f4187e0bdd2c-0' usage_metadata={'input_tokens': 755, 'output_tokens': 153, 'total_tokens': 908, 'input_token_details': {'audio': 0, 'cache_read': 0}, 'output_token_details': {'audio': 0, 'reasoning': 0}}

