content='Vitiligo ist eine Hautkrankheit. Man nennt sie auch Weißfleckenkrankheit. Bei Vitiligo verliert die Haut an manchen Stellen das braune Pigment. Das Pigment heißt Melanin. Dadurch entstehen helle Flecken auf der Haut. Diese Flecken sind unregelmäßig geformt und gut sichtbar. 

Vitiligo kann man nicht heilen, aber man kann die Krankheit behandeln. Manchmal haben Menschen mit Vitiligo auch andere Krankheiten. Zum Beispiel können sie Probleme mit der Schilddrüse haben. 

Die genauen Gründe für Vitiligo sind noch nicht bekannt. Es wird aber gedacht, dass die Gene von den Eltern eine Rolle spielen.' additional_kwargs={'refusal': None} response_metadata={'token_usage': {'completion_tokens': 136, 'prompt_tokens': 737, 'total_tokens': 873, 'completion_tokens_details': {'audio_tokens': 0, 'reasoning_tokens': 0, 'accepted_prediction_tokens': 0, 'rejected_prediction_tokens': 0}, 'prompt_tokens_details': {'audio_tokens': 0, 'cached_tokens': 0}}, 'model_name': 'gpt-4o-mini-2024-07-18', 'system_fingerprint': 'fp_0ba0d124f1', 'finish_reason': 'stop', 'logprobs': None} id='run-cae06dcf-d092-45d1-b749-596049b0ee54-0' usage_metadata={'input_tokens': 737, 'output_tokens': 136, 'total_tokens': 873, 'input_token_details': {'audio': 0, 'cache_read': 0}, 'output_token_details': {'audio': 0, 'reasoning': 0}}
